import React from "react";
import { useSelector } from "react-redux";

const Dashboard = () => {
  const user = useSelector((state) => state.details);

  return (
    <article className="max-w-2xl mx-auto px-4 py-8">
      <h4 className="text-xl font-semibold mb-4">Dashboard</h4>
      <div className="mb-4">
        <h5 className="text-lg font-semibold mb-2">{user.name}</h5>
        <p className="text-gray-600">{user.email}</p>
      </div>
      <div className="mb-8">
        <h5 className="text-lg font-semibold mb-2">Liked Courses:</h5>
        <ul className="list-disc pl-4">
          {user.liked.split("\n").map((course, index) => (
            <li key={index} className="text-gray-700">
              {course}
            </li>
          ))}
        </ul>
      </div>
      <div className="mb-8">
        <h5 className="text-lg font-semibold mb-2">Completed Courses:</h5>
        <ul className="list-disc pl-4">
          {user.completed.split("\n").map((course, index) => (
            <li key={index} className="text-gray-700">
              {course}
            </li>
          ))}
        </ul>
      </div>
      <div>
        <h5 className="text-lg font-semibold mb-2">Enrolled Courses:</h5>
        <ul className="list-disc pl-4">
          {user.enrolled.split("\n").map((course, index) => (
            <li key={index} className="text-gray-700">
              {course && course}
            </li>
          ))}
        </ul>
      </div>
    </article>
  );
};

export default Dashboard;
